function Contact() {

    return(
        <div id="contact" className="">
            <h2>Contact</h2>
            <address>
                Reach out to <a href="mailto:jonathan.pruitt@mscoding.org">Jonathan Pruitt</a>. <br></br>
                Visit my <a href="https://github.com/Jonathan-Pruitt">GitHub</a> <br />
                San Antonio, TX <br />
                USA
            </address>
        </div>
    )
}//end method

export default Contact;
